function Features() {
    return (
        <div className="flex flex-col mt-6 gap-3 justify-center items-center">
            <div className="max-w-20">
                <h3 className="text-2xl">Features</h3>
                <p className="text-GrayishBlue">Our aim is to make it quick and easy for you to access your favourite websites. 
                Your bookmarks sync between your devices so you can access them on the go.</p>
            </div>
        </div>
    )
}
export default Features
